import React from "react";
import { TextField, Button, Paper, Typography, Stack } from "@mui/material";
import { styled } from "@mui/material/styles";

import ToggleButton from "@mui/material/ToggleButton";
import ToggleButtonGroup from "@mui/material/ToggleButtonGroup";

export default function ProfileInfo() {
  const [alignment, setAlignment] = React.useState("web");

  const MyToggleButton = styled(ToggleButton)(({ theme }) => ({
    width: "200px",
  }));

  const inputStyle = {
    "& .MuiTextField-root": {
      paddingBottom: "10px",
      fontSize: "10px",
    },
    "& .MuiButton-root": { fontSize: "12px", px: 4, py: 1.5 },
  };

  return (
    <>
      <form>
        <Stack dir="rtl" direction="row" spacing={5} sx={inputStyle}>
          <div style={{ width: "50%" }}>
            <TextField
              fullWidth
              label="نام و نام‌خانوادگی"
              variant="outlined"
            />
            <TextField fullWidth label="تلفن ثابت" variant="outlined" />
            <TextField fullWidth label="موبایل" variant="outlined" />
            <TextField fullWidth label="آدرس" variant="outlined" />
            <TextField fullWidth label="ایمیل" variant="outlined" />
          </div>

          <div style={{ width: "50%" }}>
            <TextField fullWidth label="نام فروشگاه " variant="outlined" />
            <TextField
              fullWidth
              label="آدرس سایت فروشگاه "
              variant="outlined"
            />
            <TextField fullWidth label="موبایل" variant="outlined" />
          </div>
        </Stack>
      </form>
    </>
  );
}
